// SPDX-License-Identifier: Apache-2.0

pragma solidity ^0.8.3;

contract lottery {

    address payable public owner;
    uint[] public createdPools;

    constructor(){
        owner = payable(msg.sender);
    }

    struct LotteryPool{
        string poolName;
        uint poolId;
        address[] members;
        uint availableSlots;
        uint joiningFee;
        uint poolAmount;
        address poolOwner;
        address winner;
        bool isActive;
        bool isExists;
    }

    struct LotteryPoolMembers{
      bool isJoined;
      uint[] joinedPools;
      uint[] winnedPools;
    }


    event LogLotteryPoolCreated(address indexed poolOwner, uint poolId, string poolName, uint joiningFee);
    event LogLotteryPoolJoined(uint poolId, string poolName, uint joiningFee, uint poolAmount, uint availableSlots, address[] members);
    event LogLotteryPoolWinned(uint poolId, string poolName, uint joiningFee, uint poolAmount, address[] members, address indexed winner);

    mapping(uint => LotteryPool) public lotteryPools;
    mapping(address => mapping(uint => LotteryPoolMembers)) public lotteryPoolMembers;


    function createLotteryPool(string memory _poolName, uint _availableSlots, uint _joiningFee) public payable{
        require(msg.sender== owner, "Only owner can create a new lottery pool");
        require(_availableSlots > 1, "Available slots must be greater than 1");
        lotteryPools[block.timestamp] = LotteryPool(_poolName, block.timestamp, new address[](0), _availableSlots, _joiningFee, 0, msg.sender,  address(0), true, true);
        createdPools.push(block.timestamp);
        emit LogLotteryPoolCreated(msg.sender, block.timestamp, _poolName, _joiningFee);
    }

    function createMiniLotteryPool(string memory _poolName, uint _availableSlots, uint _joiningFee) public payable{
        require(msg.sender== owner, "Only owner can create a new lottery pool");
        require(_availableSlots > 1, "Available slots must be greater than 1");
        lotteryPools[block.timestamp] = LotteryPool(_poolName, block.timestamp, new address[](0), _availableSlots, _joiningFee, 0, msg.sender,  address(0), true, true);
        createdPools.push(block.timestamp);
        emit LogLotteryPoolCreated(msg.sender, block.timestamp, _poolName, _joiningFee);
    }
    function joinMiniLotteryPool(uint _poolId) public payable{
      require(lotteryPools[_poolId].isExists, "Pool doesnot exists with given Id");
      require(lotteryPools[_poolId].isActive, "Pool is not active");
      require(lotteryPools[_poolId].availableSlots > 0, "Pool is full");
      require(lotteryPools[_poolId].joiningFee == msg.value, "amount must be equal to joining fee of pool");
      require(!lotteryPoolMembers[msg.sender][_poolId].isJoined, "You are already joined in this pool");

      lotteryPools[_poolId].members.push(msg.sender);
      lotteryPools[_poolId].poolAmount += msg.value;
      lotteryPools[_poolId].availableSlots--;
      lotteryPoolMembers[msg.sender][_poolId].isJoined = true;
      lotteryPoolMembers[msg.sender][_poolId].joinedPools.push(_poolId);
      emit LogLotteryPoolJoined(_poolId, lotteryPools[_poolId].poolName, lotteryPools[_poolId].joiningFee, lotteryPools[_poolId].poolAmount, lotteryPools[_poolId].availableSlots, lotteryPools[_poolId].members);
    }
    function joinLotteryPool(uint _poolId) public payable{
      require(lotteryPools[_poolId].isExists, "Pool doesnot exists with given Id");
      require(lotteryPools[_poolId].isActive, "Pool is not active");
      require(lotteryPools[_poolId].availableSlots > 0, "Pool is full");
      require(lotteryPools[_poolId].joiningFee == msg.value, "amount must be equal to joining fee of pool");
      require(!lotteryPoolMembers[msg.sender][_poolId].isJoined, "You are already joined in this pool");

      lotteryPools[_poolId].members.push(msg.sender);
      lotteryPools[_poolId].poolAmount += msg.value;
      lotteryPools[_poolId].availableSlots--;
      lotteryPoolMembers[msg.sender][_poolId].isJoined = true;
      lotteryPoolMembers[msg.sender][_poolId].joinedPools.push(_poolId);
      emit LogLotteryPoolJoined(_poolId, lotteryPools[_poolId].poolName, lotteryPools[_poolId].joiningFee, lotteryPools[_poolId].poolAmount, lotteryPools[_poolId].availableSlots, lotteryPools[_poolId].members);
    }

    function drawWinner(uint _poolId) public payable{
      require(msg.sender == owner, "Only pool owner can draw winners");
      require(lotteryPools[_poolId].isActive, "Pool is not active with given Id");
      require(lotteryPools[_poolId].availableSlots == 0, "Pool is not filled up");

      uint ownerCommission = lotteryPools[_poolId].poolAmount * 20 / 100;
      uint winningAmount = lotteryPools[_poolId].poolAmount * 80 / 100;
      owner.transfer(ownerCommission);
      uint index = uint(keccak256(abi.encodePacked(block.difficulty, block.timestamp,lotteryPools[_poolId].members.length)));
      uint winnerIndex = index % lotteryPools[_poolId].members.length;
      address winner = lotteryPools[_poolId].members[winnerIndex];
      payable(winner).transfer(winningAmount);
      lotteryPools[_poolId].winner = winner;
      lotteryPoolMembers[winner][_poolId].winnedPools.push(_poolId);
      lotteryPools[_poolId].isActive = false;
      emit LogLotteryPoolWinned(_poolId, lotteryPools[_poolId].poolName, lotteryPools[_poolId].joiningFee, lotteryPools[_poolId].poolAmount, lotteryPools[_poolId].members, lotteryPools[_poolId].winner);
    }

    function getLotteryPoolById(uint _poolId) public view returns(LotteryPool memory){
      // require(lotteryPoolMembers[msg.sender][_poolId].isJoined, "You are not joined in this pool");
      return lotteryPools[_poolId];
    }

    function getLotteryPoolMemeberById(uint _poolId) public view returns(LotteryPoolMembers memory){
      // require(lotteryPoolMembers[msg.sender][_poolId].isJoined, "You are not joined in this pool");
      return lotteryPoolMembers[msg.sender][_poolId];
    }

     function getAllcreatedPools() public view returns(uint[] memory) {
        return createdPools;
    }

}
